@jurajloj o premiéře @sbormistrfilm: Traumatizoval mě pohled na sebe. Po skončení jsem Kačce řekl jen „promiň“. „Bylo těžké dívat se na Kačku a říkat jí to, co jí říkám, protože to se nemá dít. Šel jsem hrozně proti sobě vnitřně,” dodal Juraj na @kviff ve festivalovém Prostoru KVIFF X. 

Celý rozhovor najdete na všech platformách. 

